  import React from 'react'
  import dhLogo from 'public\images\DH.png'

  const Footer = () => {
    return (
      <footer class="footer">
          <p>Powered by</p>
          <img src={dhLogo} alt='DH-logo'/>
      </footer>
    )
  }

  export default Footer
